import React from 'react';
import Form from "../components/Form"

const fields = [
    {
        label: "Full Name",
        type: "text",
    },

]

class Success extends React.Component {



    render() {
        return (
            <Form  fields={fields} onSubmit={this.onSubmit} buttonLabel={"Register"} linkTo={"/success"}/>
        )
    }
}

export default Success
